d to safety, effectiveness and cost in planning and delivering care. The Nurse Clinician&#x27;s decisions and actions with patients and families are determined in an ethical manner. The Nurse Clinician establishes goals and strategies for meeting the discharge or continuing care needs of the patient, family, and/or other care provider. The Nurse Clinician provides care in collaboration with other nursing staff members; he/she delegates and supervises care in accordance with nurse practice acts and the professional nursing role. The Nurse Clinician utilizes research findings in his/her practice. He/she demonstrates knowledge of and participates in improving organizational performance activities. The nurse clinician acquires and maintains knowledge in nursing practice and assumes responsibility for the professional development of self, other nursing staff and students. Work Schedule 70%, evenings, 8 hour shifts - with potential 12 hour shifts in the future, &#x27;B&#x27; weekend rotation, hours may vary based on operational needs of the department. Qualifications Education: Baccalaureate degree in nursing preferred. Work Experience: One (1) year recent medical or surgical nursing experience in an inpatient setting required. Medical and surgical nursing experience preferred. Licenses &#x26; Certifications: Registration as a professional nurse in the State of Wisconsin required. CPR certification required. Medical-Surgical Nursing Certification preferred. Required Skills, Knowledge, and Abilities: Knowledge regarding quality improvement and standards of care within practice area. Experience in teaching patients and families. Excellent communication skills. Ability to effectively delegate and supervise the work of other nursing team members. Physical Requirements: Medium - Ability to lift up to 50 pounds maximum with frequent lifting/and or carrying objects weighing up to 25 pounds.\n\t\t\t\t\t<p>Source: <a rel=\"nofollow\" target=\"_blank\" href=\"http://www.juju.com/ja